, or get started by following along and contributing to other adventures.<br />\r\nThis is a new way to explore, together.</p>\r\n','','full_html'),('node','art_portfolio',0,182,182,'und',0,'<p>The Crisis Preparedness platform is a crowdsourced central repository of disaster management<br />\r\nand first response training events, created by the Center for Excellence in Disaster Management<br />\r\nand Humanitarian Assistance (CFE-DMHA). These include workshops, conferences, and<br />\r\nseminars. The goals of the Crisis Preparedness platform are:<br />\r\n• To provide a transparent aggregate picture of disaster management training events in the Asia-<br />\r\nPacific region, so that donors and funders may see gaps and allocate funding strategically rather<br />\r\nthan emotionally (as is currently the case)<br />\r\n• To improve coordination between different disaster management training organisations and<br />\r\ngovernments, and to prevent duplication of effort and funds on similar training events.<br />\r\n<br />\r\n1. Users of the Crisis Preparedness platform can submit details of disaster management<br />\r\ntraining events through a form on the platform. Each submission includes the title of the event,<br />\r\nthe date range the event will take place, the city and country of the event, the official URL of the<br />\r\nevent, and a contact name/email/phone number.<br />\r\n2. The administrator can see reports before they are published, and either approve or delete them.<br />\r\n3. The approved events are visible on a single map on the homepage.<br />\r\n4. The user can filter reports on the homepage map by date using a calendar.<br />\r\n&nbsp;</p>\r\n','','full_html'),('node','art_portfolio',0,183,183,'und',0,'<p>Sport Relief is the weekend, every two years, when the British public can get active, have fun and raise cash to help people living incredibly tough lives both in the UK and around the world.<br />\r\n<br />\r\nOur fabulous fundraisers get sponsored for Sport Relief, and go the extra mile by organising sports tournaments, quizzes and challenges to raise even more cash.<br />\r\n<br />\r\nIt all leads up to the Sport Relief weekend and a fantastic night of TV on the BBC. http://www.comicrelief.com/sportrelief</p>\r\n','','full_html'),('node','art_portfolio',0,184,184,'und',0,'<p>Since its launch in 1988, Red Nose Day has become something of a British institution. It’s the day, every two years, when people across the land can get together and do something funny for money at home, school and work.<br />\r\n<br />\r\nThere’s a fantastic night of TV on the BBC, with comedy and entertainment to inspire the nation to give generously.<br />\r\n<br />\r\nComic Relief spends the money raised by Red Nose Day to help people living tough lives across the UK and Africa.<br />\r\nhttp://www.comicrelief.com/rednoseday<br />\r\n&nbsp;</p>\r\n','','full_html'),('node','art_portfolio',0,185,185,'und',0,'<p>From Friday 17 to Sunday 19 April 2015, swimmers will take the plunge and take part in Swimathon 2015, fundraising for Marie Curie. The UK’s biggest fundraising swimming event will see thousands of people taking the plunge at hundreds of pools around the country, including the London Aquatics Centre at The Queen Elizabeth Olympic Park.</p>\r\n','','full_html'),('node','teams',0,198,198,'und',0,'<p>Web developer</p>\r\n','','full_html');
