DROP TABLE IF EXISTS `newsletter_list`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `newsletter_list` (
  `nlid` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'The unique ID of this list.',
  `title` varchar(255) NOT NULL COMMENT 'The list’s title.',
  `send_rate` varchar(11) NOT NULL DEFAULT 'Manual' COMMENT 'How often to send this list.Manual,Daily,Weekly or Monthly.',
  `last_sent` int(11) DEFAULT NULL COMMENT 'Timestamp this list was last sent.',
  `send_again` date DEFAULT NULL COMMENT 'Date this list needs to be sent again.',
  `created` int(11) DEFAULT '0' COMMENT 'The creation timestamp of this subscriber.',
  PRIMARY KEY (`nlid`),
  UNIQUE KEY `list_title` (`title`),
  KEY `list_created` (`created`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='Contains the newsletter subscriber lists with their...';
